INSERT INTO `cars` VALUES (1,'Mercedes','Benz',2008,75000,'Silver','6 Speed Automatic','3.0 Liter Inline 6','','','','DFG3463DHDFJT36363FGHFG','Genuine Mercedes-Benz replacement parts and accessories installed by certified technicians preserve the performance and integrity of your vehicle. As well, keeping it genuine with Mercedes-Benz parts will help maintain your vehicle\'s residual value.\r\n\r\nWhen you visit your local Mercedes-Benz dealership, their service staff can perform a detailed, multi-point inspection to address your concerns and maintain your vehicle\'s performance and appearance.',15000.00,'2014-02-18',16000.00,'2014-02-19',1,0,0.00,'0000-00-00','2014-02-19 08:16:39','2014-02-19 06:05:00','2014-02-19 08:16:39'),(2,'Ford','F-150',2003,88945,'Black','5 Speed Manual','5.4L V8','','','','DSTWSADG235235325DFHDSFHDFSH2321523','KC Motorz is a small local business specializing in used cars and trucks. We also offer a wide variety of service from vehicle customization to fine detailing. We have been working on cars for over 15 years, and are dedicated to selling nothing but the finest trucks in the area. We specialize in diesel trucks as well as lifted vehicles.\r\n\r\nIf you in the market for ANY automobile, please let us know, we are happy to help find you the right car at the right price!',6524.00,'2014-02-13',19999.00,'2014-02-18',1,0,0.00,'0000-00-00','2014-07-30 11:38:11','2014-02-19 07:01:16','2014-07-30 11:38:11'),(3,'','',0,0,'Red','5 Speed Automatic','','','','','','',0.00,'0000-00-00',0.00,'0000-00-00',1,0,0.00,'0000-00-00','2014-02-19 07:04:22','2014-02-19 07:02:57','2014-02-19 07:04:22'),(4,'Accura','NSX',1999,54000,'Grey','6 Speed Automatic','V6','','','','FDGSDFGSFDG345345SDFGSDFGDSFG','KC Motorz is a small local business specializing in used cars and trucks. We also offer a wide variety of service from vehicle customization to fine detailing. We have been working on cars for over 15 years, and are dedicated to selling nothing but the finest trucks in the area. We specialize in diesel trucks as well as lifted vehicles.\r\n\r\nIf you in the market for ANY automobile, please let us know, we are happy to help find you the right car at the right price!',5000.00,'2014-02-10',10000.00,'2014-02-20',1,0,0.00,'0000-00-00','2014-07-30 11:38:17','2014-02-19 08:14:46','2014-07-30 11:38:17'),(5,'Fake','Car',2020,564165,'Silver','5 Speed Manual','V12','','','','65135132132','Option\r\nOption\r\nOption\r\nOption\r\nOption',502000.00,'2014-07-24',999999.99,'2014-07-31',1,0,0.00,'','2014-07-30 11:38:23','2014-07-30 08:42:33','2014-07-30 11:38:23'),(6,'Ford','F350',2005,269000,'White','5 Speed Automatic','6.0','4 Wheel Drive','Diesel','Clean','1FTWW31P85EB02341','Year- 2005\r\nMake- Ford\r\nModel- F350 Lariat\r\nEngine- 6.0 Powerstroke Diesel\r\nDoors- 4 Crew Cab Long Bed\r\nDrive- 4WD\r\nMiles- 269,318\r\nCondition Exterior- 7 out of 10 (Ex work truck and has normal dings and dents here and there\r\nCondition Interior- 8 out of 10\r\nOption\'s- Power Sliding rear window, sunroof, factory trailer breaks, power everything, wood grain, cold AC, Like new firestone LT tires, CD, Seat heaters, abs, tilt, am fm,\r\n\r\nTruck is mechanically flawless, runs and drives great, just a little beat up from the job site',7215.00,'06/25/2014',10500.00,'07/31/2014',0,1,9500.00,'8/26/2014',NULL,'2014-07-31 00:52:58','2014-08-26 23:08:26'),(7,'Lexus','ES300',2002,177000,'Silver','5 Speed Automatic','3.0L V6','Front Wheel Drive','Gas','Clean','JTHBF30G925031791','2002 Lexus ES300 with 177k miles, Car is in amazing condition, with 0 mechanical issues at all, new breaks, new tires, body has no damage, no check engine lights, its a 9 out of 10 all the way around, and air is ICE COLD. Leather is in great shape and has a new set of good year tires. Come look and drive it you will not be disappointed. being sold as is, KC MO Clean Clear title in hand MO inspected as well.\r\n\r\n\r\nV6 3.0\r\nAutomatic 5 spd\r\nFWD\r\nTraction Control\r\nABS\r\nAC\r\nPower EVERYTHING\r\nCruise\r\nTilt Wheel\r\nAM/FM\r\nCassette\r\nCD Multi\r\nDual Air Bags\r\nSide Air Bags\r\nDual power seats with Seat Heaters\r\nLeather\r\nSunroof\r\nAlloy Wheels with new goodyear tires ',4340.00,'07/22/2014',6800.00,'07/31/2014',0,1,5750.00,'08/16/2014',NULL,'2014-07-31 01:24:52','2014-08-18 21:48:22'),(8,'Nissan','Pathfinder',2002,201000,'Red','5 Speed Automatic','3.5L V6','','','','JN8DR09Y72W746045','Up for sale is a 2002 Nissan Pathfinder SE, Comes with Bose package, sunroof roof rack, good tires and well maintained this Pathfinder has 200k on and runs great, cold a/c and drives smooth.\r\n\r\n\r\n4x4\r\nBose sound system\r\nPower windows\r\nPower door locks\r\nPower mirrors\r\nKeyless entry\r\nCold A/C\r\nAlloy wheels\r\nRoof rack\r\nFog lights\r\nNerf bars\r\nTow package\r\nSunroof',3040.00,'',5000.00,'2014-07-10',0,1,4000.00,'11/24/2014',NULL,'2014-07-31 01:57:58','2014-11-24 23:27:00'),(9,'Nissan','Titan',2005,226000,'Silver','5 Speed Automatic','5.6L V8','','','','1N6BA07B65N559816','2005 Nissan Titan SE King Cab 4x4 Off Road Pkg. Truck has 226,641 miles but runs and drives good! 5.6L V8 and Great options like multi disc cd, with aux for iPod, Dual Exhaust sounds good, Rear Glass window is power up and down, Front end has a 1.5in Leveling kit to bring it up for the tires. Wheels and tires are cool, the tires only have about 10xxx miles left on them before needing replaced and they ride like mud tires, so its not a Cadillac. Truck is not perfect, has normal dings and dents for the age, body has a few as well. but there are no check engine lights, and the ac is ice cold! Clean clear title in hand, come and drive her you wont be disappointed!\r\n\r\n\r\nOptions-\r\nMiles- 226k\r\nAutomatic Trans\r\n4WD\r\nOff Road PKG\r\nABS\r\nAir Conditioning\r\nPower Sliding rear window\r\nPower windows\r\nPower Locks\r\nCruise Control\r\nPower steering\r\nTilt Wheel\r\nAM/FM Multi Cd\r\nPremium Sound with iPod Aux cord\r\nDual Air Bags\r\nUnder body Hoist\r\nBed Liner\r\nTowing Package\r\nPremium Wheels\r\nOver sized Off Road Tires',4260.00,'07/03/2014',7000.00,'07/31/2014',0,1,7000.00,'08/22/2014',NULL,'2014-07-31 02:02:32','2014-08-22 01:36:09'),(10,'Acura','TL',2001,184000,'Black','5 Speed Automatic','3.2L v6','Front Wheel Drive','Gas','Clean','19UUA56631A031411','2001 Acura TL with 180k miles, runs and drives amazing! Cold AC new Front breaks, pads and rotors, no check engine lights, shifts smooth, ready for a daily driver, gets about 27mpg on the highway if you baby her. Clean title in hand, Car has normal dings and dents for a 14year old car, hood and trunk have some sap spots from sitting under a tree. Bose Stereo and heated seats!',2340.00,'',4100.00,'',0,1,3300.00,'2014-11-13',NULL,'2014-07-31 02:11:20','2014-11-17 21:47:45'),(11,'GMC','SIERRA 2500 HD',2005,299000,'Silver','5 Speed Automatic','6.6L','','','','1GTHK23215F825569','2005 GMC Sierra SLT 2500 3/4 ton 4x4 Crew Cab Short Bed 6.6L (LLY) Duramax equipped with a Allison transmission. 299k miles on the truck and it runs and drives amazing almost looks new! This is not a new truck, has been worked so there are minor scratches, chips ect... But the paint sines up very nice! Tires are like new and 33\' A/T. Previous owner had injectors replaced last year. New MOOG front end ball joints and end links. Truck needs nothing but a driver. Power everything, LED Signal mirrors, turnover ball in bed, hot heat, cold ac. Again truck needs nothing mechanically, just get in and drive! \r\n\r\n\r\nOptions-\r\n299,xxx miles\r\nV8 Turbo Diesel 6.6L LLY Duramax\r\nAutomatic Allison Transmission\r\n4WD\r\nSLT\r\nABS\r\nAir Conditioning\r\nPower Windows, Locks, Steering\r\nTilt Wheel\r\nCruise Control\r\nAM FM Stereo\r\nCassette\r\nPremium Bose Sound\r\nCD Single Dics\r\nOnStar\r\nLeather Seats with seat heaters\r\nDual Air Bags\r\nTowing Package, with Turnover Ball in bed\r\nPremium Wheels\r\nOversize Off Road Tires\r\nElectric Trailer Breaks\r\nKey less Entry\r\